import React from "react";
import { useEffect, useState } from "react";
import Axios from "axios";

function MyAd() {
  const [dbIDC, setDbIDC] = useState(null);
  const [myAds, setMyAds] = useState([]);

  useEffect(() => {
    Axios.get("http://localhost:3001/login").then((response) => {
      if (response.data.loggedIn === true) {
        setDbIDC(response.data.user[0].id);
      }
    });
  }, []);

  useEffect(() => {
    Axios.get("http://localhost:3001/adverts", {
      rental_agency_id: dbIDC,
    }).then((response) => {
      setMyAds(response.data);
    });
  }, []);

  return (
    <div>
      <h1> This are my ads</h1>
      {myAds.map((val) => {
        return (
          <div>
            Description: {val.description} | Rent: {val.rent} | AdID:
            {val.id_property_ad}
            {val.id_property_ad}
          </div>
        );
      })}
    </div>
  );
}

export default MyAd;
